drop database if exists EDUBANK_DB;

create database EDUBANK_DB  DEFAULT CHARACTER SET latin1 
COLLATE latin1_general_cs;

USE EDUBANK_DB;

CREATE TABLE TELLER (
	TELLER_ID INT(3),
	LOGIN_NAME VARCHAR(5) UNIQUE NOT NULL,
	PASSWORD VARCHAR(100) NOT NULL,
	CONSTRAINT PS_TELLER_ID_PK PRIMARY KEY ( TELLER_ID )
);

CREATE TABLE CUSTOMER (
	CUSTOMER_ID BIGINT(10) AUTO_INCREMENT,
	EMAILID VARCHAR(255) UNIQUE NOT NULL,
	NAME VARCHAR(100) NOT NULL,
	DATE_OF_BIRTH DATE NOT NULL,
	SECURITY_QUESTION_ID BIGINT(10),
	SECURITY_ANSWER VARCHAR(100),
	CREATED_TIMESTAMP TIMESTAMP NOT NULL,
	CREATED_BY INT(3) NOT NULL,
	MODIFIED_TIMESTAMP TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	MODIFIED_BY INT(3),
	CONSTRAINT PS_CUSTOMER_ID_PK PRIMARY KEY ( CUSTOMER_ID )
);

CREATE TABLE CUSTOMER_LOGIN (
	CUSTOMER_LOGIN_ID INT(6) AUTO_INCREMENT,
	LOGIN_NAME VARCHAR(20) UNIQUE NOT NULL,
	PASSWORD VARCHAR(100) NOT NULL,
	CUSTOMER_ID BIGINT(10) NOT NULL,
	LOCKED_STATUS VARCHAR(10) DEFAULT 'UNLOCKED' NOT NULL, -- 'LOCKED'/'UNLOCKED'
	MODIFIED_TIMESTAMP TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	CONSTRAINT PS_CUSTOMER_LOGIN_ID_PK PRIMARY KEY ( CUSTOMER_LOGIN_ID )
);

CREATE TABLE BRANCH (
	BRANCH_ID INT(4),
	IFSC VARCHAR(11) UNIQUE NOT NULL,
	BRANCH_NAME VARCHAR(50) NOT NULL,
	BRANCH_CODE VARCHAR(6) NOT NULL,
	CONSTRAINT PS_BRANCH_ID_PK PRIMARY KEY ( BRANCH_ID )
);

CREATE TABLE ACCOUNT (
	ACCOUNT_ID INT(6) AUTO_INCREMENT,
	ACCOUNT_NUMBER VARCHAR(15) UNIQUE NOT NULL,
	BRANCH_ID INT(4) NOT NULL,
	BALANCE FLOAT(12,4) NOT NULL,
	LOCKED_BALANCE FLOAT(12,4) DEFAULT 0 NOT NULL,
	ACCOUNT_STATUS VARCHAR(10) DEFAULT 'ACTIVE' NOT NULL, -- 'ACTIVE'/'INACTIVE'
	CONSTRAINT PS_ACCOUNT_ID_PK PRIMARY KEY ( ACCOUNT_ID )
);

CREATE TABLE ACCOUNT_CUSTOMER_MAPPING (
	ACCOUNT_CUSTOMER_MAPPING_ID INT(6) AUTO_INCREMENT,
	ACCOUNT_NUMBER VARCHAR(15) NOT NULL,
	CUSTOMER_ID BIGINT(10) NOT NULL,
	MAPPING_STATUS VARCHAR(10) DEFAULT 'ACTIVE' NOT NULL, -- 'ACTIVE'/'INACTIVE'
	CONSTRAINT PS_ACCOUNT_CUSTOMER_MAPP_ID_PK PRIMARY KEY ( ACCOUNT_CUSTOMER_MAPPING_ID )
);

CREATE TABLE DEBIT_CARD (
	DEBIT_CARD_ID INT(6)AUTO_INCREMENT,
	DEBIT_CARD_NUMBER VARCHAR(16) NOT NULL UNIQUE,
	ACCOUNT_CUSTOMER_MAPPING_ID INT(6) NOT NULL,
	CVV VARCHAR(100) NOT NULL,
	VALID_FROM DATE NOT NULL,
	VALID_THRU DATE NOT NULL,
	PIN VARCHAR(100) NOT NULL,
	LOCKED_STATUS VARCHAR(10) DEFAULT 'UNLOCKED' NOT NULL, -- 'LOCKED'/'UNLOCKED'
	DEBIT_CARD_STATUS VARCHAR(10) DEFAULT 'ACTIVE' NOT NULL, -- 'ACTIVE'/'INACTIVE'
	CREATED_TIMESTAMP TIMESTAMP NOT NULL,
	CREATED_BY INT(3) NOT NULL,
	MODIFIED_TIMESTAMP TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	CONSTRAINT PS_DEBIT_CARD_ID_PK PRIMARY KEY ( DEBIT_CARD_ID )
);


CREATE TABLE TRANSACTION (
	TRANSACTION_ID INT(10) AUTO_INCREMENT,
	ACCOUNT_NUMBER VARCHAR(15) NOT NULL,
	AMOUNT FLOAT(12,4) NOT NULL,
	TRANSACTION_DATE_TIME TIMESTAMP DEFAULT CURRENT_TIMESTAMP() NOT NULL,
	TYPE VARCHAR(10) NOT NULL, -- 'CREDIT'/'DEBIT'
	TRANSACTION_MODE VARCHAR(20) NOT NULL,
	REMARKS VARCHAR(30),
	INFO VARCHAR(200) NOT NULL,
	CREATED_BY VARCHAR(50) NOT NULL,
	CONSTRAINT PS_TRANSACTION_ID_PK PRIMARY KEY ( TRANSACTION_ID )
);

CREATE TABLE EDUBANK_SECURITY_QUESTION (
	QUESTION_ID BIGINT(10) AUTO_INCREMENT,
	QUESTION VARCHAR(255) UNIQUE NOT NULL,
	CONSTRAINT EDU_SQ_QUESTION_ID_PK PRIMARY KEY ( QUESTION_ID )
);


